import React from "react";
import "./Dash.css";

function Dashboard() {
  return (
    <div className="chat-app-dashboard">
      {/* First portion with blue background */}
      <div className="blue-portion"></div>

      {/* Second portion with light gray background */}
      <div className="gray-portion">
        {/* Chat messages */}
        <div className="chat-messages">
          {/* Display chat messages here */}
          <div className="message">User 1: Hello!</div>
          <div className="message">User 2: Hi there!</div>
          {/* Add more messages as needed */}
        </div>

        {/* Input field */}
        <div className="chat-input">
          <input
            type="text"
            placeholder="Type your message..."
            // Additional input field styles can be added here
          />
          <button>Send</button>
        </div>
      </div>
    </div>
  );
}
export default Dashboard;
